TempleInMap::TempleInMap()
{
	Init();
	DrawOwnScn();
}

TempleInMap::~TempleInMap()
{
}

void TempleInMap::Update(Vector2 offset)
{
	mOffset = { offset.x_,offset.y_ };
	/*mPlayer->Update();*/
}

void TempleInMap::DrawOwnScn()
{
	for (int x = 0; x < MAP_X; x++)
	{
		for (int y = 0; y < MAP_Y; y++)
		{
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[ti_soil[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[ti_obj1[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[ti_obj2[y][x]], true);

		}
	}

}

bool TempleInMap::Init(void)
{
	if (LoadDivGraph("./image/map.png", 2800, 56, 50, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}
	
	return true;
}

